import React from 'react';

const EventBanner =()=>{
    return(
        <section className="event_banner_area">
            <div className="parallax-effect"></div>
            <div className="container">
                <div className="event_banner_content">
                    <div className="round wow zoomIn" data-wow-delay="0.2s"></div>
                    <h6 className="wow fadeInUp" data-wow-delay="0.6s">24 de Novembro 2021</h6>
                    <h2 className="wow fadeInUp" data-wow-delay="0.8s"><span>Curso de </span>Mediação<br/> Conectare <span>2021</span></h2>
                    <a className="event_btn btn_hover wow fadeInLeft" data-wow-delay="0.9s" href="/#">Matricule-se</a>
                    <a className="event_btn event_btn_two btn_hover wow fadeInRight" data-wow-delay="0.9s" href="/#">Como funciona?</a>
                </div>
            </div>
        </section>
    )
}

export default EventBanner;
